import DIRECT from "./page/DIRECT";
import AUTHCO from "./page/AUTHCO";
import PAKMATS from "./page/PAKMATS";
import SCHOOL from "./page/SCHOOL";
import MALAM from "./page/MALAM";
import ADMIN from "./page/ADMIN";
import { Link } from "react-router-dom";

export default function Page() {
  const { user, getUser } = useContext(UserContext);

  switch (user && user.Role) {
    case "SCREW":
      return (
        <div className="pageSwitcher" onClick={() => {}}>
          <SCREW />
        </div>
      );
    case "DIRECT":
      return (
        <div className="pageSwitcher">
          <DIRECT />
        </div>
      );
    case "AUTHCO":
      return (
        <div className="pageSwitcher">
          <AUTHCO />
        </div>
      );
    case "PAKMATS":
      return (
        <div className="pageSwitcher">
          <PAKMATS />
        </div>
      );
    case "SCHOOL":
      return (
        <div className="pageSwitcher">
          <SCHOOL />
        </div>
      );
    case "MALAM":
      return (
        <div className="pageSwitcher">
          <MALAM />
        </div>
      );
    case "ADMIN":
      return (
        <div className="pageSwitcher">
          <ADMIN />
        </div>
      );
    default:
      return (
        <div className="pageSwitcherThatisEmptybecuaseuser is balmaz">
          <p> מי זה? </p>
          <Link to="/login">הזדהה</Link>
        </div>
      );
  }
}
